/*jshint esversion: 6 */
const settings = {
  debug: true // Enable debug mode for better visibility
};

// 3D OBJECTS SPECIFICATIONS:
const meshPath = 'trainingData/models3D/erractic/';
const objects = [
  {
    label: 'ERRACTIC',
    distance: 3,
    trainingSets: [
      {
        meshes: [
          meshPath + 'erractic.glb',
        ],
        envMapMats: 'ALL',
        alterMapMats: ['PlasticRed', 'PlasticBlue', 'PlasticGreen'],
        // Simplified material tweakers - less random variation
        materialsTweakers: {
          'MetalSilver': function(mat) {
            mat.reflectivity = 0.7; // Fixed value instead of random
            mat.metalness = 0.8;
            mat.roughness = 0.3;
            mat.envMapIntensity = 2;
          },
          'Plastic': function(mat) {
            mat.reflectivity = 0.5;
            mat.metalness = 0;
            mat.color.r = 0.5 + 0.5 * Math.random(); // Less variation
            mat.color.g = 0.5 + 0.5 * Math.random();
            mat.color.b = 0.5 + 0.5 * Math.random();
            mat.roughness = 0.3;
            mat.envMapIntensity = 1;
          }
        },
        scale: 0.02,
        thetaOffset: 180,
        thetaRange: [-180, 180],
        probability: 1,
        isCenter: false,
        // Start with fewer images for testing
        images: [
          'trainingData/images/erractic/image1.png',
          'trainingData/images/erractic/image2.png',
          'trainingData/images/erractic/image3.png'
        ]
      }
    ]
  }
];

// NEURAL NETWORK LAYERS (Reduced complexity):
const layers = [];
const activationConv = 'arctan2';
const activation = 'gelu';

layers.push({
  preprocessing: 'inputMix0',
  varianceMin: 0.05,
  gain: 1.1,
  blurKernelSizePx: 5, // Reduced from 7
  sizeSqrt: 64 // Reduced from 128
});

layers.push({
  sizeSqrt: 64, // Reduced from 128
  connectivityUp: 'conv',
  sparsitySqrt: 6, // Reduced from 8
  kernelsCountSqrt: 2, // Reduced from 4
  activation: activationConv
});

layers.push({
  connectivityUp: 'conv',
  sizeSqrt: 16, // Reduced from 32
  sparsitySqrt: 8, // Reduced from 16
  kernelsCountSqrt: 2, // Reduced from 4
  maxPooling: null,
  activation: activation
});

layers.push({sizeSqrt: 8, connectivityUp: 'full', shiftRGBAMode: 2, activation: activation}); // Reduced from 16
layers.push({sizeSqrt: 8, connectivityUp: 'full', shiftRGBAMode: 2, activation: activation}); // Reduced from 16
layers.push({sizeSqrt: 8, connectivityUp: 'full', shiftRGBAMode: 2, activation: activation}); // Reduced from 16

layers.push({
  connectivityUp: 'full',
  clampOutput: "mask",
  sizeSqrt: ObjectDetectionTrainer.compute_outputSize(objects.length),
  activation: 'copy'
});

// INITIALIZE NETWORK:
const net = new NeuronNetwork({exportData: {}, layers: layers});

// PREPROCESSING / POSTPROCESSING PIPELINES:
const preprocessingPipeline = new ImageTransformPipeline([]);
const postprocessingPipeline = new ImageTransformPipeline([]);

// PROBLEM DEFINITION (Reduced complexity):
const problem = new Problem({
  provider: 'ObjectDetectionTrainer',
  preprocessing: preprocessingPipeline,
  postprocessing: postprocessingPipeline,
  options: {
    objects: objects,
    phiRange: [20, 120],
    translationScalingFactors: [0.3, 0.15, 0.3],
    translationScalingFactorsDistributions: ['uniform', 'uniform', 'uniform'],
    rotZ: {max: 30, nSigmas: 4},
    width: 256, // Reduced from 512
    aspectRatio: 1,
    isSharedContext: true,
    FOV: [3, 10],
    pointLightNumberRange: [1, 1], // Reduced max from 2 to 1
    ambientLightIntensityRange: [0.5, 1.5], // Narrower range
    updatePointLightsPeriod: 200, // Increased from 100 (less frequent updates)
    pointLightMaxIntensity: 0.8, // Reduced from 1
    envMaps: true,
    // Simplified noise textures
    noiseTextures: [
      {image: 'trainingData/images/random/output_*.png', n: 1, scaleRange: [0.05, 0.2], scalePow: 2}, // Reduced n from 2 to 1
    ],
    positiveProbability: 0.7,
    detectedObjScoreMin: 0.5,
    splitYawComponents: true,
    outputYaw: true,
    outputPitch: true,
    outputRoll: true
  }
});

// TRAINER (Optimized for browser performance):
const trainer = new Trainer({
  network: net,
  problem: problem,
  testsCount: 2000, // Reduced from 5000
  testMinibatchsInterval: 5000, // Reduced from 10000
  cost: 'quadratic',
  SGDLearningRate: 0.03, // Slightly reduced from 0.05
  SGDLearningRatePeriod: 500000, // Reduced from 1000000
  SGDMomentum: 0.7,
  stopAfterMinibatchsCount: 0,
  minibatchSize: 50, // Significantly reduced from 200
  display: true,
  updateLiveDisplayMinibatchsInterval: 50, // Reduced from 100 (more frequent updates)
  delayBetweenMinibatchs: 100, // Increased from 5 (gives browser time to breathe)
  l2Decay: 0.0000002
});

// START TRAINING:
console.log('Starting optimized WebAR training...');
console.log('Reduced parameters:');
console.log('- Image size: 512 → 256');
console.log('- Minibatch size: 200 → 50');
console.log('- Layer sizes reduced by ~50%');
console.log('- Kernel counts reduced');
console.log('- Light complexity reduced');
trainer.start();
